export default function AddCountry() {
    return (
        <div className=" flex flex-col gap-4 pt-8">
            <h2 className="text-xl">Add new country</h2>
            <input type="text" placeholder="Country name" className="border-2 border-gray-300 rounded-xl" />
            <input type="text" placeholder="Description" className="border-2 border-gray-300 rounded-xl" />
            <input  placeholder="Image" className="border-2 border-gray-300 rounded-xl" />
            <button className="px-4 py-2 bg-blue-500 hover:bg-blue-700 text-white rounded-xl">Add</button>
        </div>
    );
}
